:::

Also, recall that @fig-corr-plot previously described the correlation structure of these predictors. There were several clusters of predictors with strong magnitudes of correlation. This implies that there is some redundancy of information in these features. However, machine learning is often "a game of inches," where even redundant predictors can contribute incremental improvements in performance. In any case, the analyses in this chapter will be profoundly affected by this characteristic; it will be discussed in more detail below. 

Individually, how does each of these features appear to relate to the outcome? To assess this, we binned each predictor into roughly 20 groups based on percentiles and used these groups (each containing about 230 locations) to compute the rate of forestation and 90% confidence intervals^[Binning is used here as a visualization tool; we re-emphasize that converting numeric predictors into categorical features is problematic.]. As an exploratory tool, we can use these binned versions of the data to see potential relationships with the outcome. @fig-forest-percentiles shows the profiles. Note that there is enough data in each bin to make the confidence intervals very close to the estimated rates. 


::: {.cell layout-align="center"}
::: {.cell-output-display}
![Binned rates of forestation over percentiles of the numeric predictors. The shaded regions are 90% confidence intervals.](cls-linear_files/figure-html/fig-forest-percentiles-1.svg){#fig-forest-percentiles fig-align='center' width=80%}
:::
:::


Quite a few predictors show considerable nonlinear trends, and a few are not monotonic (i.e., the sign of the slope changes over the range of values). The Eastness and Northness features, which capture the landscape orientation at the location, show flat trends. This means that these predictors are less likely to be important. However, once in a model with other predictors, the model may be able to extract some utility from them, perhaps via interaction terms. The primary takeaway from this visualization is that models that are able to express nonlinear trends will probably do better than those restricted to linear classification boundaries. 

In addition to longitude and latitude, the data contains a qualitative location-based predictor: the county in Washington. There are data on 39 counties. The number of locations within each county can vary with San Juan county having the least training set samples (6) and Okanogan having the most (365). @fig-counties shows how the rate of forestation changes and the uncertainty in these estimates. Several counties in the training set have no forested locations. Given the number of counties and their varying frequencies of data, an effect encoding strategy might be appropriate for this predictor. 


::: {.cell layout-align="center"}
::: {.cell-output-display}
![Outcome rates for different counties in Washington State.](cls-linear_files/figure-html/fig-counties-1.svg){#fig-counties fig-align='center' width=40%}
:::
:::


Finally, it might be a good idea to assess potential interaction effects prior to modeling. Since almost all of our features are numeric, it can be difficult to assess interactions visually, so the H-statistics for two-way interactions were calculated using a boosted tree as the base model using the numeric features. Since there are only 105 possible interactions, the H-statistics were recomputed 25 times using different random number generators so that we can compute a mean H-statistic and its associated standard error. 


::: {.cell layout-align="center"}
::: {.cell-output-display}
![Results for the top 25 H-statistic interactions. The error bars are 90% intervals based on replicate computations.](cls-linear_files/figure-html/fig-forested-interactions-1.svg){#fig-forested-interactions fig-align='center' width=90%}
:::
:::


The vast majority of the 105  H-statistics are less than 0.215 and there are a handful of interactions that are greater than that value; we’ll take the five interactions and use them in a logistic regression shown below.

The next section will describe a mainstay of machine learning models for two classes: logistic regression. 

